import { Box, Card, Link } from "@chakra-ui/react";
import NextImage from "next/image";

interface BlogCardProps {
    id: string;
    title: string;
    date: string;
    eyecatchUrl: string;
}

const NO_IMAGE_URL =
    "data:image/data:image/png;base64,";

export const BlogCard = (props: BlogCardProps) => {
    const date = new Date(props.date);

    return (
        <Link href={`/blogs/${props.id}`}>
            <Card.Root size="sm" w="100%" overflow="hidden" flexDir={{ base: "row", sm: "column" }}>
                <Box position="relative" w={{ base: "32%", sm: "auto" }} h={{ base: "auto", sm: "180px" }}>
                    <NextImage
                        src={props.eyecatchUrl}
                        fill
                        sizes="(max-width: 278px) 30vw, (max-width: 278px) 30vw"
                        placeholder={NO_IMAGE_URL}
                        style={{
                            objectFit: "cover",
                        }}
                        alt={`${props.title}のサムネイル`}
                    />
                </Box>
                <Card.Body>
                    <Card.Title truncate>{props.title}</Card.Title>
                    <Card.Description>{`${date.getFullYear()}年 ${date.getMonth() + 1}月${date.getDate()}日`}</Card.Description>
                </Card.Body>
            </Card.Root>
        </Link>
    );
};
